```sparql
PREFIX dbo: <http://dbpedia.org/ontology/>
PREFIX dbr: <http://dbpedia.org/resource/>

SELECT ?professional ?producer ?associatedArtist WHERE {
  # Find the album "What U See Is What U Get"
  VALUES ?album { dbr:What_U_See_Is_What_U_Get_(50_Cent_album) }

  # Find works (songs) in this album
  ?song dbo:album ?album .
  ?song a dbo:Songs .

  # Find the professional and producer of these songs
  ?professional dbo:profession "musician"^^xsd:string ;
                dbo:worksForProduct ?song .
  OPTIONAL { ?producer dbo:produced ?song . }

  # Find associated musical artist of the writer (50 Cent)
  ?writer dbo:associatedMusicalArtist ?associatedArtist ;
          a dbo:MusicalArtist .
  FILTER(?writer = dbr:50_Cent)

}
```

