SELECT DISTINCT ?war1 ?war2 ?person WHERE {
  # Part 1: War of the commander in the work of --01-09
  ?work dbo:date "2009-01-01"^^xsd:date ;
        dbo:commander ?commander .
  ?commander dbo:participatedInWar ?war1 .

  # Part 2: War of the military force of the entity, that is a societal event, in Chile
  ?entity dbo:location dbr:Chile ;
          dbo:societalEvent ?societalEvent .
  ?militaryForce dbo:militaryForceOf ?entity ;
                 dbo:participatedInWar ?war2 .

  # Part 3: Force of the person born as Narciso Campero
  ?person foaf:name "Narciso Campero" ;
          dbo:birthName "Narciso Campero" .
  ?force dbo:commandedBy ?person .
}
```

